import {createRouter, createWebHistory} from "vue-router";
import Home from "./src/pages/Home/Home.vue";
import ColorPicker from "./src/components/Main/Projects/ColorPicker/ColorPicker.vue";
import SnakeGame from "./src/components/Projects/Snake/Snake."

 export const routes = [
    {
        path: "/",
        name: "Home",
        component: Home
    },
    {
        path: "/colorpicker",
        name: "ColorPicker",
        component: ColorPicker
    }
]

const router = createRouter({
    history: createWebHistory(),
    routes
});

export default router;
